import ProfileForm from './ProfileForm';
import classes from './UserProfile.module.css';
import backgroundImage from '../../OIP.jpg'; // Import the image

const UserProfile = () => {
    // Define a style object for the background
    const backgroundStyle = {
      backgroundImage: `url(${backgroundImage})`, // Use the imported image as the background
      backgroundSize: 'cover', // Adjust this to control how the image covers the background
    };
  return (

    <section className={classes.profile} style={backgroundStyle}>
      <ProfileForm />
    </section>
  );
};

export default UserProfile;
